import React from 'react';
import './App.css';

function App() {
  return (
    <nav class="navigation">
      <ul>
        <a href="#"><img src="./public/img/logo1.png"></img></a>
        <li>E-shop</li>
        <li>Men</li>
        <li>Women</li>
        <li>Kids</li>
      </ul>
  </nav>
  );
}

export default App;
